import React from 'react'
import '../App/App.css';
import {SidebarData} from '../Sidebar/SidebarData';
import Banner from '../Banner/Banner';
import Body from '../Body/Body';

class AboutMe extends React.Component{
    render(){
        let item = SidebarData.find(item => item.title === "About Me");
        return (
            <div className='pages'>
                <Banner 
                imageSrc = {item.imgSrc}
                thisIs = "Chalida Pisuraj"
                descript= "Fun fact: My legal name is a combination of my siblings' names. Charlie + Tida = Chalida! It also happens to be a fairly uncommon Thai name."
                />
            </div>
        )
    }
}

export default AboutMe;
